INSERT INTO `blogs` (`id`, `name`, `description`, `image`, `date`) VALUES
(10, 'Blackberry Moonrock Cocktail', 'If you\'re looking for a sophisticated and unique cocktail to impress your guests, look no further than the Blackberry Moonrock. This drink combines the tart sweetness of blackberries with the smoothness of bourbon and the herbal notes of Chartreuse for a drink that is truly out of this world.  To make a Blackberry Moonrock, you will need:  • 1.5 oz bourbon  • 0.5 oz Chartreuse  • 0.5 oz blackberry syrup  • 0.5 oz fresh lemon juice  • 1 blackberry, for garnish  To start, combine the bourbon, Chartreuse, blackberry syrup, and lemon juice in a cocktail shaker filled with ice. Shake vigorously until well chilled, then strain into a chilled glass. Garnish with a fresh blackberry and serve immediately.  The Blackberry Moonrock is a drink that is perfect for sipping on a warm summer evening, or for enjoying after dinner as a digestif. The blackberry syrup provides a fruity sweetness that is balanced by the complex flavors of the bourbon and Chartreuse. The lemon juice adds a bright citrusy note that ties everything together.  One of the best things about the Blackberry Moonrock is how easy it is to make. With just a few ingredients and a shaker, you can have a delicious and impressive cocktail ready in no time. Plus, the deep purple color of the drink is sure to catch the eye of anyone nearby.  If you\'re a fan of bourbon or herbal liqueurs, the Blackberry Moonrock is definitely a drink worth trying. It\'s a unique and flavorful cocktail that is sure to impress your guests at your next party or gathering. So next time you\'re in the mood for something special, mix up a Blackberry Moonrock and enjoy the otherworldly flavors.', , '2023-03-19');
INSERT INTO `blogs` (`id`, `name`, `description`, `image`, `date`) VALUES
(11, 'Life Cycle of Cannabis', 'Cannabis, also known as marijuana, is a plant that has been used for medicinal and recreational purposes for thousands of years. Like all plants, cannabis has a life cycle that starts with a seed and ends with the production of more seeds. In this blog, we\'ll explore the life cycle of cannabis in detail.  Germination: The cannabis life cycle begins with the germination of a seed. When a seed is exposed to moisture and warmth, it will begin to sprout. The first signs of germination are the appearance of a taproot and a small shoot. At this stage, the cannabis plant needs a lot of water and humidity to continue growing.  Seedling stage: After the seed has sprouted, it enters the seedling stage. The plant will grow its first set of true leaves, and it will start to produce chlorophyll. At this stage, the cannabis plant is fragile and needs to be protected from extreme temperatures and light.  Vegetative stage: In the vegetative stage, the cannabis plant will grow rapidly. It will produce more leaves, stems, and branches. During this stage, the plant needs a lot of light and nutrients to support its growth. The vegetative stage can last anywhere from a few weeks to several months.  Flowering stage: The flowering stage is when the cannabis plant begins to produce buds. This stage is triggered by changes in the light cycle, specifically by reducing the amount of light the plant receives. During this stage, the cannabis plant will focus all its energy on producing buds, and the leaves will begin to yellow and die off.  Harvest: When the buds are fully matured, it\'s time to harvest the cannabis plant. The buds should be cut from the plant and dried before they can be used. The drying process is important to ensure that the buds don\'t mold or rot. Once the buds are dry, they can be used for medicinal or recreational purposes.  Seed production: If the cannabis plant is allowed to continue growing after the harvest, it will begin to produce seeds. The seeds can be collected and used to grow new cannabis plants.  In conclusion, the life cycle of cannabis is a fascinating process that requires the right conditions and care. From germination to seed production, each stage is essential to the growth and development of the plant. By understanding the life cycle of cannabis, we can appreciate the plant\'s beauty and its many uses.', , '2023-03-19');
INSERT INTO `blogs` (`id`, `name`, `description`, `image`, `date`) VALUES
(12, '20,000 Pot Arrests During The Pandemic', 'Police in Pennsylvania made 20,200 arrests for marijuana possession in 2020, a year marked by the coronavirus pandemic and the subsequent designation of cannabis businesses as essential services in many jurisdictions. Arrest data from the Pennsylvania State Police showed that an average of 55 adults were arrested for cannabis possession in the state every day last year.  The data, which includes arrests by state and local police throughout the Keystone State, was acquired by Chris Goldstein, a regional coordinator with the National Organization for the Reform of Marijuana Laws (NORML). Goldstein helped draft Philadelphia’s 2014 cannabis decriminalization ordinance, a move that was followed by action to reform marijuana laws in more than a dozen additional Pennsylvania cities, including the state capital of Harrisburg.  “Cannabis consumers were targeted even during the Covid-19 pandemic,” Goldstein said in a statement from NORML. “This shows just how aggressively prohibition is enforced, despite the unprecedented public health risks in our communities. It’s time to stop marijuana arrests, right now.”  The data from law enforcement shows that police in Pennsylvania made more arrests for marijuana possession than for all other illegal substances combined, which totaled 17,425 arrests.', , '2023-05-26');

